import React, { useState, useEffect } from 'react';

const Modal = ({ isOpen, onClose, data, URL }) => {
    if (!isOpen) return null;
    [amount, setAmount] = useState(10);
    const thingy = async () => {
        const operations = await fetch(`${URL}/operation?amount=10`);
          // Handle response
          if (operations.ok) {
            const response = await operations.json();
            console.log(response.operations);
          } else {
            // Error saving operation
            console.error('Failed to import operations');
          }
    }

    const changeAmount = (e) => {
        amount = e.target;
        setAmount(amount);
        console.log(amount);
    }

    return (
        <div className="modal">
            <div className="modal-content">
                <span className="close" onClick={onClose}>&times;</span>
                <input className='InputBox' onChange={changeAmount}/>
                <button onClick={ async() => {await thingy();}}>Import</button>
            </div>
        </div>
    );
};

export default Modal;
